    for x1,x2,x3 in combinations_with_replacement(range(1,n+1),3):
        for y1,y2,y3 in product(range(1,n+1),repeat=3):
            den = (x1-x2)*(y1-y3)-(x1-x3)*(y1-y2)<<2
